import React, {Component} from 'react';
import {DashboardNavigationWrapper} from "../styled/Common.styled";
import {DashboardLogo} from "../styled/Dashboard.styled";
import PressLogo from "../assets/press_login_hero.svg"

function DashboardNavigation() {
        return (
            <DashboardNavigationWrapper>
                <DashboardLogo src={PressLogo}/>
            </DashboardNavigationWrapper>
        );
}

export default DashboardNavigation;
